import React, { useState } from 'react';
import { MdCheck, MdKeyboardArrowLeft } from 'react-icons/md';
import { Form, Input } from '@rocketseat/unform';
import * as Yup from 'yup';
import { useDispatch, useSelector } from 'react-redux';

import { Container, EditRecipient, FormRecipient } from './styles';
import HeaderPages from '../../../../components/HeaderPages';
import history from '../../../../services/history';
import IconButton from '../../../../components/IconButton';
import ButtonBack from '../../../../components/ButtonBack';
import * as RecipientActions from '../../../../store/modules/recipient/actions';
import AvatarInput from '../AvatarInput';

export default function CriacaoEntregador() {
  const dispatch = useDispatch();
  const profile = useSelector(state => state.user.profile);

  function handleSubmit(data) {
    //dispatch(updateProfileRequest(data));
  }

  function handleSignOut() {
    //dispatch(signOut());
  }

  return (
    <Container>
      <Form initialData={profile} onSubmit={handleSubmit}>
        <AvatarInput name="avatar_id" />
        <Input name="name" placeholder="Full name" />
        <Input name="email" type="email" placeholder="Your e-mail address" />

        <hr />

        <Input
          name="oldPassword"
          type="password"
          placeholder="Your actual password"
        />
        <Input
          name="password"
          type="password"
          placeholder="Your new password"
        />
        <Input
          name="confirmPassword"
          type="password"
          placeholder="Confirm your new password"
        />

        <button type="submit">Update Profile</button>
      </Form>

      <button type="button" onClick={handleSignOut}>
        Logout
      </button>
    </Container>
  );
}
